import React, { useState, useMemo } from 'react';
import { usePalette } from 'color-thief-react';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Box, Typography, CircularProgress, Alert } from '@mui/material';
import { adjustHexColor } from '../util/color';

const imageData = "data:image/png;base64,"
const ThemeGenerator = ({ children }) => {

  // The usePalette hook from color-thief-react will extract a palette of colors.
  // We're asking for 2 colors here to create a primary and secondary color.
  const { data: palette, loading, error } = usePalette(imageData, 3, 'hex', {
    crossOrigin: 'anonymous',
  });

  // We create a new theme based on the extracted palette.
  // useMemo ensures we don't recreate the theme on every render unless the palette changes.
  const dynamicTheme = useMemo(() => {
    // Use extracted colors, or fall back to your original theme colors.
    const primaryColor = palette?.[0] || '#000000';
    const secondaryColor = palette?.[1] || '#D3D3D3';

    return createTheme({
      palette: {
        primary: {
          main: primaryColor,
        },
        secondary: {
          main: secondaryColor,
        },
        background: {
          default: primaryColor, // Light gray background for light mode
          paper: secondaryColor,
          // White background for paper-like surfaces
        },
        text: {
          primary: '#000000', // Default text color
          secondary: '#ffffff', // Secondary text color
        }
        // It's a good practice to recalculate contrast text
        // but for this example we'll keep it simple.
      },
      components: {
        MuiAppBar: {
          styleOverrides: {
            colorPrimary: { // This targets the AppBar when its color prop is 'primary' (default)
              backgroundColor: adjustHexColor(primaryColor, 10), // Your desired custom color
            },
          },
        },
        MuiIconButton: {
          styleOverrides: {
            root: {
              backgroundColor: adjustHexColor(primaryColor, 20), // Darken the icon color
            },
          },
        },
        MuiCircularProgress: {
          styleOverrides: {
            root: {
              color: adjustHexColor(primaryColor, 30), // Darken the circular progress color
            },
          },
        },
        MuiListItemText: {
          styleOverrides: {
            primary: {
              fontSize: '0.8rem',
              color: adjustHexColor(secondaryColor, 40),
            },
            secondary: {
              fontSize: '1rem',
              fontWeight: 'medium',
            },
          },
        }
      }
    });
  }, [palette]);

  return (
    <ThemeProvider theme={dynamicTheme}>
      {children}
    </ThemeProvider>
  );
};

export default ThemeGenerator;